    // Your code here to execute when a swipe down is detected\n  }\n}\n\n// Add event listeners for touchstart and touchend events\ndocument.addEventListener('touchstart', handleTouchStart, false);\ndocument.addEventListener('touchend', handleTouchEnd, false);\n\n\n\n"},"ports":[{"name":"out-SwipeUP","displayName":"SwipeUP","plug":"output","type":"signal","group":"Outputs","index":4},{"name":"out-SwipeDown","displayName":"SwipeDown","plug":"output","type":"signal","group":"Outputs","index":5}],"children":[]},{"id":"c1eca8d2-14ee-915c-0c24-60e1880919a7","type":"States","parameters":{"states":"hidden,visible","values":"opacity","value-hidden-opacity":0,"value-visible-opacity":1,"transitiondef-visible":{"curve":[0,0,1,1],"dur":1500,"delay":500},"transitiondef-hidden":{"curve":[0,0,1,1],"dur":1500,"delay":500},"transition-visible-opacity":{"curve":[0,0,1,1],"dur":1000,"delay":300}},"ports":[],"children":[]},{"id":"7b4850f9-ded5-c4a1-b1a6-b0667f41a374","type":"Timer","parameters":{"duration":1000},"ports":[],"children":[]},{"id":"869c14f3-4ad2-a959-5a75-2faa5fa062c6","type":"Event Receiver","parameters":{"channelName":"pointerUp"},"ports":[],"children":[]},{"id":"71fabcb7-d41d-14df-92a0-584718f7276d","type":"Switch","parameters":{"onFromStart":false},"ports":[],"children":[]},{"id":"cb8ebd7f-e767-7146-e107-9ec6b81a2f1d","type":"JavaScriptFunction","parameters":{"functionScript":"// Initialize the canvas when the signal is sent\nif (Inputs.InitCanvasSignal) {\n  //let container = document.querySelector('.canvasContainer')\n  let p5Image;\n  let fetchInProgress = false;\n  let imgSrcCheck;\n  let startTime;\n  let duration = 1800;\n  let resolutions = [2, 4, 8, 16, 32, 64, 80, 100, 120];\n  let currentIndex = 0;\n\n  let canvas = document.createElement(\"div\");\n  document.querySelector('.canvasContainerMobile').appendChild(canvas);\n  \n  sketch = function (p) {\n    p.setup = function () {\n      p.createCanvas(Inputs.width, Inputs.height)\n      startTime = p.millis();\n    }\n\n    p.draw = function () {\n      p.background(255)\n\n      if (p5Image) {\n        //p.image(p5Image, 0, 0, Inputs.width*2, Inputs.height*2)\n        \n\n        let elapsedTime = p.millis() - startTime;\n\n        if (elapsedTime < duration) {\n          let progress = elapsedTime / duration;\n          let index = Math.floor(progress * resolutions.length);\n          currentIndex = index;\n        } else {\n          currentIndex = -1;\n        }\n        if (currentIndex >= 0 && currentIndex < resolutions.length) {\n          p.pixelateImage(p5Image, resolutions[currentIndex]);\n        } else {\n          p.image(p5Image, 0, 0);\n        }\n      }\n      \n      if(Inputs.pointerUp){\n        fetchInProgress = true;\n        p5Image = false;\n      }\n\n      if (fetchInProgress) {\n        // true while on pointer up\n        if(imgSrcCheck == Inputs.imgSrc){\n          // already fetched return; \n          return;\n        }else{\n          // store src and continue\n          imgSrcCheck = Inputs.imgSrc\n        }\n        var imgSrc = Inputs.imgSrc\n        console.log(imgSrc)\n        \n        // fetch png img from src\n        fetch(imgSrc)\n          .then((response) => response.blob())\n          .then((blob) => {\n            let img = new Image()\n            img.src = URL.createObjectURL(blob)\n            img.onload = () => {\n              p5Image = p.createImage(img.width, img.height)\n              p5Image.drawingContext.drawImage(img, 0, 0)\n              p5Image = p.cropRandomCorner(p5Image, p5Image.width/2, p5Image.height/2);\n              fetchInProgress = false;\n              startTime = p.millis();\n            }\n          })\n          .catch((error) => {\n            console.error('Error fetching image:', error)\n          })\n        \n        fetchInProgress = false;\n      }\n      \n    }\n    p.pixelateImage = function (img, resolution) {\n      // Calculate the size of each square based on the input resolution\n      let squareWidth = img.width / resolution;\n      let squareHeight = img.height / resolution;\n\n      // Iterate through the image and sample the color at each step based on the input resolution\n      for (let y = 0; y < img.height; y += squareHeight) {\n        for (let x = 0; x < img.width; x += squareWidth) {\n          let centerX = x + squareWidth / 2;\n          let centerY = y + squareHeight / 2;\n\n          // Get the color at the center of the square\n          let color = img.get(centerX, centerY);\n          // Set the fill color to the sampled color\n          p.noStroke();\n          p.fill(color);\n          //p.ellipse(x, y, squareWidth+1, squareHeight+1);\n          p.rect(x, y, squareWidth+1, squareHeight+1);\n        }\n      }\n    }\n    \n    p.cropRandomCorner = function (img, cropWidth, cropHeight) {\n      // Ensure the crop dimensions are smaller than the original image dimensions\n      if (cropWidth > img.width || cropHeight > img.height) {\n        console.error(\"Crop dimensions are larger than the original image dimensions.\");\n        return img;\n      }\n\n      // Randomly select one of the four corners\n      let corner = Math.floor(p.random(4));\n\n      let x, y;\n\n      switch (corner) {\n        case 0: // Top-left corner\n          x = 0;\n          y = 0;\n          break;\n        case 1: // Top-right corner\n          x = img.width - cropWidth;\n          y = 0;\n          break;\n        case 2: // Bottom-left corner\n          x = 0;\n          y = img.height - cropHeight;\n          break;\n        case 3: // Bottom-right corner\n          x = img.width - cropWidth;\n          y = img.height - cropHeight;\n          break;\n      }\n\n      // Get the cropped section of the image\n      let croppedImage = img.get(x, y, cropWidth, cropHeight);\n\n      croppedImage.resize(Inputs.width, Inputs.height);\n      return croppedImage;\n    }\n\n    p.windowResized = function () {\n      p.resizeCanvas(Inputs.width, Inputs.height)\n    }\n  }\n\n  p = new p5(sketch, canvas)\n}\n\n"},"ports":[{"name":"in-InitCanvasSignal","displayName":"InitCanvasSignal","plug":"input","type":"*","group":"Inputs","index":4},{"name":"in-width","displayName":"width","plug":"input","type":"*","group":"Inputs","index":5},{"name":"in-height","displayName":"height","plug":"input","type":"*","group":"Inputs","index":6},{"name":"in-pointerUp","displayName":"pointerUp","plug":"input","type":"*","group":"Inputs","index":7},{"name":"in-imgSrc","displayName":"imgSrc","plug":"input","type":"*","group":"Inputs","index":8}],"children":[]},{"id":"2c834008-c542-8088-9356-2bdc9055776d","type":"Timer","parameters":{"duration":1},"ports":[],"children":[]},{"id":"a34fdad2-0c47-fceb-b294-3cdad9149dc5","type":"Event Receiver","parameters":{"channelName":"mapMoving"},"ports":[],"children":[]},{"id":"2311527b-4b6a-ae2e-4ba7-afd11cfb0f87","type":"Timer","parameters":{"duration":1000},"ports":[],"children":[]},{"id":"539d9454-cfb4-f54a-93f6-3615c63fd749","type":"Event Receiver","parameters":{"channelName":"pointerUp"},"ports":[],"children":[]},{"id":"eecd1777-912b-2abe-a1f8-e8c9624e2ad4","type":"Switch","parameters":{"onFromStart":false},"ports":[],"children":[]},{"id":"ad575da1-1935-dca5-2aed-04f3488fed10","type":"JavaScriptFunction","parameters":{"functionScript":"// Initialize the canvas when the signal is sent\nif (Inputs.InitCanvasSignal) {\n  //let container = document.querySelector('.canvasContainer')\n  let p5Image;\n  let fetchInProgress = false;\n  let imgSrcCheck;\n  let startTime;\n  let duration = 1800;\n  let resolutions = [2, 4, 8, 16, 32, 64, 80, 100, 120];\n  let currentIndex = 0;\n\n  let canvas = document.createElement(\"div\");\n  document.querySelector('.canvasContainerPortrait').appendChild(canvas);\n  \n  sketch = function (p) {\n    p.setup = function () {\n      p.createCanvas(Inputs.width, Inputs.height)\n      startTime = p.millis();\n    }\n\n    p.draw = function () {\n      p.background(255)\n\n 